function setTiles(tiles) {//ÈªÑÈáë-Â∏¶Âª∂ËøüÊîæÁΩÆÊñπÂùóÔºàÁõ∏ÂØπ‰ΩçÁΩÆÔºâ
	var playerPosition = {
		x: Player.getX(),
		y: Player.getY(),
		z: Player.getZ()
	};
	var index = 0;
	var intervalId = setInterval(function() {
		if (index < tiles.length) {
			var tile = tiles[index];
			setTile(playerPosition.x + tile[0], playerPosition.y + tile[1], playerPosition.z + tile[2], tile[3], 0);
			index++;
		} else {
			clearInterval(intervalId); // ÂÆåÊàêÊâÄÊúâËÆæÁΩÆÂêéÊ∏ÖÈô§ÂÆöÊó∂Âô®
		}
	}, 100); // ÊØè100ÊØ´ÁßíÊâßË°å‰∏ÄÊ¨°ÔºåÂç≥ÊØè0.1Áßí
}